window.bookSummaryJSON = "<p><b>It’s a universally known fact that all omegas want is a pack and a safe place for their babies.</b></p> <p><i>Wrong.</i></p> <p>That’s not what all omegas want. I don’t want it either. When I screw up my chances of being matched with a pack, I’m sent to the Omega Auctions. There, I’m sold to a royal pack to be their maid.</p> <p>I’m hardly qualified to clean, and I’m not sure being stuck with an unmated pack is the best idea because my first heat is coming and these guys are H.O.T. <i>Hot</i>.</p> <p>My name is Reagan and I’m a bad omega who refuses to fall in love. Let’s just hope my heart gets the memo, because that’s knot the life for me.</p>"; 
